import styled from 'styled-components';

export const HeaderBody = styled.header`
  display: flex;
  align-items: center;
  justify-content: space-between;
  background-color: rgb(30, 30, 30);
  color: white;
`;

export const HeaderImg = styled.img`
width: 100px;
height: 50px;

:nth-child(odd) {
  filter: invert(100%)
}
`;

export const Title = styled.h1``;
